$.fn.liveSearch=function(e){var t,n,i=$(e.table);$(this).keyup(function(){t=i.find("td"),n=$(this).val().toLowerCase(),i.find("tr:gt(0)").hide(),t.each(function(e,t){-1!=t.innerHTML.toLowerCase().indexOf(n)&&$(t).closest("tr").show()})})};
